Spesifikasi

1.Frekuensi kerja: Standar nasional (920~925MHz), standar Amerika (902~928MHz), atau sesuaikan frekuensi lainnya

2. Protokol Dukungan: ISO18000-6B, ISO18000-6C (EPC GEN2);
3. Lompatan Frekuensi:
FHSS atau frekuensi tetap yang diatur oleh perangkat lunak;
4. Cara kerja:
secara otomatis membaca kartu pada waktu yang teratur, dapat mengatur cara membaca kartu;
5. Daya Frekuensi:
0 ~ 30dBm, disesuaikan dengan perangkat lunak;

6. Jarak Baca: 1-5M

7. Sensitivitas Membaca:
pembacaan polarisasi ganda;
8. Kecepatan Membaca:
satu label 64 bit nomor ID <6ms;
9. Antena:
antena polarisasi melingkar built-in, dapatkan antena polarisasi linier 8dB / built-in, dapatkan 12dBi
10. Antarmuka:
RS485, RS232, Wiegand26, Wiegand34, RJ45;
11. Tegangan kerja: DC+12V;
12. Indikasi Status Kerja: bel
13. Kekuasaan: 1W
14.Suhu kerja: -20℃ ~ +80;
15. Suhu Penyimpanan:
-40℃ ~ +125;
16Kelembaban Kerja: 20% ~ 95% (tanpa kondensasi)
Dimensi: 227mm × 227mm × 60mm


Pembaca UHF RFID memiliki banyak keuntungan dari dukungan protokol yang lebih banyak, pembacaan cepat, identifikasi label yang lebih banyak, antena polarisasi melingkar, dan desain yang ringkas.

UHF RFID Writer dan Reader dengan jangkauan menengah, 6-8 meter.

Features:
*Adopt low power dissipation, high performance, long distance RFID module design;
*Support EPC global Class1 Gen2/ISO 18000-6C protocol tag;
*840~868MHz/902~928MHz frequency band (frequency customization optional);
*FHSS or Fix Frequency transmission;
*RF output power up to 30dBm (1dbm step adjustable);
*Built-in 8 dbi circular polarized antenna, effective distance over 5m;
*Support command, Auto and trigger working mode;
*Low power dissipation with single +12V DC power supply;
*Support RS232, RS485, Wiegand and Trigger interfaces;
*RJ45 (TCP/IP, UDP) and WIFI interface are optional, PoE optional;
*Support EPC, TID and USER inventory in independently or conjunctively;
*Outdoor Rating: IP54

Dimensi : 235 x 235 x 57 mm

GUI didukung:
- Android
- Java (Demo + SDK)
- C# (Demo + SDK)
- C++ (SDK)
